import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import Ndata from "./Ndata";

function ncard(val) {
  return (
    <App
      pic={Ndata[val].pic}
      cat={Ndata[val].cat}
      tit={Ndata[val].tit}
      link={Ndata[val].link}
      dlink={Ndata[val].dlink}
    />
  );
}

ReactDOM.render(
  <>
    <h4 className="heading_style">Top 5 Naats in 2023</h4>
    {Ndata.map(ncard)}
  </>,
  document.getElementById("root")
);
